import './App.css';
import Car from './Car'


function App() {
  return (
    <>
    <div className="App">
      <h1>Hello buddy!</h1>
    </div>
    <div><p>hello there</p></div>
    <Car brand='Ford'/>
    </>
  );
}

export default App;
